ret[206].TextValue = "<div>\n\t&bull;<span style=\"white-space:pre\"> </span>Hospital Information System Implementation and installation of all hospital administrative and financial system users and parameters.</div>\n<div>\n\t&bull;<span style=\"white-space:pre\"> </span>Controlling hospital information security and authorization of users Maintaining an ongoing control on all financial and monetary systems to ensure proper delivery of financial statements Responsible for all hospital-wide inventory control Integration of hospital departments through HIS modules Revision of user activities to optimize system utilization Developing interfaces for third-parties and facilitating data interchange.</div>\n<div>\n\t&bull;<span style=\"white-space:pre\"> </span>IP Telephony Implementation of an open-source IP telephony system in a hybrid environment where old telephone sets were maintained to reduce TCO and at the same time integrate them with the IP telephony solution to provide state-of-the-art PBX systems.</div>\n<div>\n\t&bull;<span style=\"white-space:pre\"> </span>Surveillance System Administration of a POE network of cameras with HD support to control all hospital public areas and administrative posts.</div>\n<div>\n\t&bull;<span style=\"white-space:pre\"> </span>Decision Support Advanced analytical data collection and aggregation for specific needs of the management Automation of quarterly analysis Implementation of decision-support as part of the electronic auditing framework Integration of decision-support with the electronic quality system.</div>\n<div>\n\t&nbsp;</div>";
