ret[268].TextValue = "<p>\n\tPatient information in healthcare organizations is distributed across several systems and data silos. Clinicians make decisions based on data in patient health records. Improving the efficiency of decision-support requires collective knowledge of all patient information. The classical approach of linking patient data from many databases into one data warehouse poses various problems when it comes to building clinical analytics. An implementation of the Performance Measurement and Management approach used in Engineering and Business is adapted to healthcare scenarios, and a new system is developed that allows clinicians that are not technical professionals to develop, test and apply custom analytics to patient health data. Part I of this paper is an introduction to the problems and current situation in healthcare data analytics. Part II states the aim and objectives. Part III explains the system design and its modular components. Part IV presents the results of three performance indicators evaluated through the system, and evaluates the system through technical and clinical usability methods. Part V concludes and discusses future work.</p>";
